import React, { Component } from "react";
// import { useParams } from "react-router-dom";
import Footer from "../layout/Footer";
import Header from "../layout/Header";
import Sidebar from "../layout/Sidebar";
import withRouter from "../withRouter";
import moment from "moment";
const axios = require("axios").default;

class ProjectFinance extends Component {
  constructor(props) {
    super(props);
    this.state = {
      financeList: [],
      lastAmtDate: "",
      lastAmtReceived: "",
      totalReceivedAmt: "",
      balanceAmt: "",
      amountAllocatedTillDate: 0,
      expenditureTillDate: 0,
    };
    this.myfunction = this.myfunction.bind(this);
  }

  // andriod, native
  myfunction() {
    let allocatedFund = 0;
    for (var i = 0; i < this.state.financeList.length; i++) {
      allocatedFund += parseInt(this.state.financeList[i].allocated_fund);
      console.log(allocatedFund);
    }
    // return allocatedFund
    let remaningFund = (this.state.balanceAmt / allocatedFund) * 100;
    remaningFund = (Math.round(remaningFund * 100) / 100).toFixed(2);
    // return remaningFund
    if (5 < remaningFund) {
      return "Invoice due within 3 month";
    } else if (2 < remaningFund && 5 > remaningFund) {
      return "Invoice due next month";
    } else if (0.5 <= remaningFund && 2 > remaningFund) {
      return "Invoice due next week";
    } else if (0.5 > remaningFund) {
      return "Invoice due next day";
    }
  }

  componentDidMount() {
    console.log("Props:", this.props.params.id);

    axios
      .get(
        process.env.REACT_APP_BASE_URL +
          "/api/admin/project-finance-details/" +
          this.props.params.id
      )
      .then((response) => {
        if (response.data.status) {
          let fundList = response.data;
          var financeList = this.state.financeList;
          financeList = response.data.financeList;
          this.setState({
            financeList: financeList,
            totalReceivedAmt: response.data.totalReceivedAmt,
            lastAmtReceived: response.data.lastAmtReceived,
            lastAmtDate: response.data.lastAmtDate,
            balanceAmt: response.data.balanceAmt,
            amountAllocatedTillDate: response.data.amountTillDate,
            expenditureTillDate: response.data.utilizedAmt,
          });
        }
      })
      .catch((error) => {
        console.log(error.response.data.message);
      });
  }

  render() {
    return (
      <>
        <Header />
        <Sidebar />
        <div className="content-wrapper">
          {/* Content Header (Page header) */}
          <div className="content-header">
            <div className="container-fluid">
              <div className="row">
                <div className="col-md-12 card">
                  <table class="table">
                    <thead>
                      <tr>
                        <th scope="col"> S.no </th>
                        <th scope="col"> Budget Head </th>
                        <th scope="col"> Total Fund Allocated </th>
                        <th scope="col"> Total Amout Received </th>
                        <th scope="col"> Total Expenditure </th>
                        <th scope="col"> Utilization(%) </th>
                      </tr>
                    </thead>
                    <tbody>
                      {this.state.financeList.map((item, index) => (
                        <tr key={index}>
                          <th scope="row"> {index + 1}</th>
                          <td>{item.budget_head.toUpperCase()}</td>
                          <td>{item.allocated_fund}</td>
                          <td>
                            {" "}
                            {index == 2 ? this.state.totalReceivedAmt : ""}{" "}
                          </td>
                          <td>{item.expenditure ? item.expenditure : 0}</td>
                          <td>
                            {" "}
                            {Math.round(
                              (item.expenditure / item.allocated_fund) * 100
                            )}
                            %{" "}
                          </td>
                        </tr>
                      ))}

                      {/* {(index == 2)? moment(this.state.lastAmtDate).format("DD-MM-YYYY"): ''} */}
                    </tbody>
                  </table>
                </div>
              </div>
              {/* <div className="row">
                  <div class="card bg-primary col-md-3">
                    <div class="card-header">
                    Amount Allocated Till Date
                    </div>
                    <div className="card-body">
                      <p> {this.state.amountAllocatedTillDate}</p>
                    </div>
                  </div>
                  <div class="card bg-primary col-md-3">
                    <div class="card-header">
                    Amount Received Till Date
                    </div>
                    <div className="card-body">
                      <p> {this.state.totalReceivedAmt}</p>
                    </div>
                  </div>
                  <div class="card bg-primary col-md-3">
                    <div class="card-header">
                    Amount Yet To Be Received
                    </div>
                    <div className="card-body">
                      <p> {this.state.amountAllocatedTillDate - this.state.totalReceivedAmt}</p>
                    </div>
                  </div>
                  <div class="card bg-primary col-md-3">
                    <div class="card-header">
                    Expenditure Till Date
                    </div>
                    <div className="card-body">
                      <p> {this.state.expenditureTillDate}</p>
                    </div>
                  </div>
                  <div class="card bg-gradient-success col-md-3">
                    <div class="card-header">
                    Fund Surplus/ Deficit
                    </div>
                    <div class="card-body">
                      <p class="card-text"> {this.state.balanceAmt}</p>
                    </div>
                  </div>
                  <div class="card bg-gradient-gray col-md-3">
                    <div class="card-header">
                      Last Received Amount
                    </div>
                    <div class="card-body">
                      <p class="card-text"> {this.state.lastAmtReceived}</p>
                    </div>
                  </div>

                  <div class="card bg-primary col-md-3">
                    <div class="card-header">
                      Last Received Amount Date
                    </div>
                    <div className="card-body">
                      <p> {moment(this.state.lastAmtDate).format("DD-MM-YYYY")}</p>
                    </div>
                  </div>
                  <div className="card bg-danger col-md-3">
                    <div className="card-header">
                      <p style={{ color: "white"}}>Status / Invoice Date</p>
                    </div>
                    <div className="card-body">
                      <p style={{ color: "white"}}> {this.myfunction()}</p>
                    </div>
                  </div>
              </div> */}
              <div className="row">
                <div className="col-md-3 col-6">
                  <a href="/fund-wise-project-list">
                    <div className="small-box card customcolor">
                      <div className="icon">
                        <i
                          className="fa fa-globe text-primary"
                          style="font-size: 30px; top: 15px; right: 20px;"
                        ></i>
                      </div>
                      <p className="text-dark"> Sanctioned Fund(Cr.) </p>
                      <h5 className="small-box-footer"> 964840192 </h5>
                    </div>
                  </a>
                </div>
                <div className="col-md-3 col-6">
                  <div className="small-box card">
                    <div className="icon">
                      <i
                        className="fa fa-area-chart text-success"
                        style="font-size: 30px; top: 15px; right: 20px;"
                      ></i>
                    </div>
                    <p> Fund Released(Cr.) </p>
                    <h5 className="small-box-footer"> 251617150 </h5>
                  </div>
                </div>
                <div className="col-md-3 col-6">
                  <div className="small-box card">
                    <div className="icon">
                      <i
                        className="fa fa-window-maximize text-warning"
                        style="font-size: 30px; top: 15px; right: 20px;"
                      ></i>
                    </div>
                    <p> Fund Utilized(Cr.) </p>
                    <h5 className="small-box-footer"> 259627143 </h5>
                  </div>
                </div>
                <div className="col-md-3 col-6">
                  <div className="small-box card">
                    <div className="icon">
                      <i
                        className="fa fa fa-adjust  text-info"
                        style="font-size: 30px; top: 15px; right: 20px;"
                      ></i>
                    </div>
                    <p> Fund Surplus/ Deficit(Cr.) </p>
                    <h5 className="small-box-footer text-danger"> -8009993 </h5>
                  </div>
                </div>
              </div>
            </div>
            {/* /.container-fluid */}
